import React, { Component } from 'react';
import {getMovie} from '../../services/fakeMovieService'

class Movie extends Component {
    state = {
        movie: getMovie()
    };

    render() {
        const header = ['Title','Genre','Stock','Rate'];
        return (
            <table>
                <thead>
                    <tr>
                        {header.map(title => <th>{title}</th>)}
                    </tr>
                </thead>
            </table>
        );

    }
}
